INSERT INTO `flypie_category_description` VALUES (59, 2, '飞拍VR6 Pro', '&lt;p&gt;&lt;font face=&quot;Helvetica Neue, Helvetica, Arial, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Flypie VR6 Pro是一款性能优异的无人机，它可以让你轻松地探索以前无法到达的地方。便携式和可折叠的VR6 Pro随时准备与您在任何地方。&lt;/span&gt;&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', '飞拍VR6 Pro', 'Flypie VR6 Pro是一款性能优异的无人机，它可以让你轻松地探索以前无法到达的地方。便携式和可折叠的VR6 Pro随时准备与您在任何地方。', 'Flypie VR6 Pro是一款性能优异的无人机，它可以让你轻松地探索以前无法到达的地方。便携式和可折叠的VR6 Pro随时准备与您在任何地方。');
INSERT INTO `flypie_category_description` VALUES (63, 1, 'Original battery TS61.', '&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;The TS61 smart battery designed for flypie VR6 Pro, with a capacity of 4250mAh and a voltage of 14.4v, provides 37 minutes of flight time.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;Fly shoot VR6 Pro TS61 intelligent battery, featuring the latest technology to ensure that the flight, flight control system can real-time access to current remaining power is used to calculate the rest of the flight time, users also can pass the uavs fly on APP to view real-time battery state of batteries, cycles, temperature and so on complete information.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;In addition to the status monitoring of the flight process, the intelligent battery management system also has overcharge and over-discharge protection to prevent battery damage.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;When the battery is not in use for a long time, the TS61 smart battery will automatically discharge to 50%, keeping the battery in the best condition and the service life will last longer.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;If you fly in a cold area, the system will start cryogenic protection, which will control the output of the battery according to the temperature, so that the battery can provide the power at the right temperature and protect the battery from the low temperature damage.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;The TS61 smart battery technology can not only monitor battery status, extend service life, but also provide safe and reliable battery monitoring to make flying safer.&lt;/span&gt;&lt;/p&gt;', 'Original battery TS61.', 'The TS61 smart battery designed for flypie VR6 Pro, with a capacity of 4250mAh and a voltage of 14.4v, provides 37 minutes of flight time.', 'The TS61 smart battery designed for flypie VR6 Pro, with a capacity of 4250mAh and a voltage of 14.4v, provides 37 minutes of flight time.');
INSERT INTO `flypie_category_description` VALUES (61, 2, '组件', '&lt;p&gt;无人机组件:飞行器;遥控器;相机;云台;WIFI-图传;充电器;智能飞行电池(TS50);智能飞行电池(TS61);App&lt;/p&gt;', '组件', '无人机组件:飞行器;遥控器;相机;云台;WIFI-图传;充电器;智能飞行电池(TS50);智能飞行电池(TS61);App', '无人机组件:飞行器;遥控器;相机;云台;WIFI-图传;充电器;智能飞行电池(TS50);智能飞行电池(TS61);App');
INSERT INTO `flypie_category_description` VALUES (60, 1, 'VR6 Pro', '&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;v2.5K video recording, two axis mechanical cloud platform, 200 million panoramic image, maximum endurance of 37 minutes.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'FlyPieVR6', 'FlyPieVR6,2.5K video recording, two axis mechanical cloud platform, 200 million panoramic image, maximum endurance of 37 minutes.', 'FlyPieVR6,2.5K video recording, two axis mechanical cloud platform, 200 million panoramic image, maximum endurance of 37 minutes.');
INSERT INTO `flypie_category_description` VALUES (60, 2, 'VR6 Pro', '&lt;p&gt;&lt;span style=&quot;font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px;&quot;&gt;2.5K视频录制,两轴机械云台,2亿全景图,最大续航37分钟&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '飞拍VR6 ', '飞拍VR6 ,2.5K视频录制,两轴机械云台,2亿全景图,最大续航37分钟', '飞拍VR6 ,2.5K视频录制,两轴机械云台,2亿全景图,最大续航37分钟');
INSERT INTO `flypie_category_description` VALUES (61, 1, 'Components', '&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;Uav components: aircraft; The remote control. The camera; Yuntai. WIFI - figure pass; The charger. Intelligent flight battery (TS50); Intelligent flight battery (TS61); The App&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Components', 'Uav components: aircraft; The remote control. The camera; Yuntai. WIFI - figure pass; The charger. Intelligent flight battery (TS50); Intelligent flight battery (TS61); The App', 'Uav components: aircraft; The remote control. The camera; Yuntai. WIFI - figure pass; The charger. Intelligent flight battery (TS50); Intelligent flight battery (TS61); The App');
INSERT INTO `flypie_category_description` VALUES (64, 1, 'Propeller', '&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;The original propeller 6625 provides the most stable and reliable power output for VR6 Pro.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Original propeller 6625.', 'The original propeller 6625 provides the most stable and reliable power output for VR6 Pro.', 'The original propeller 6625 provides the most stable and reliable power output for VR6 Pro.');
INSERT INTO `flypie_category_description` VALUES (62, 1, 'Original battery TS50.', '&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;A smart battery designed for flypie VR6 Pro, with a capacity of 3450mAh and a voltage of 14.4v, provides 28 minutes of flight time.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;Flypie VR6 Pro using the latest technology of intelligent battery, ensure flight, flight control system can real-time access to current remaining power is used to calculate the rest of the flight time, users also can pass the uavs fly on APP to view real-time battery state of batteries, cycles, temperature and so on complete information.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;In addition to the status monitoring of the flight process, the intelligent battery management system also has overcharge and over-discharge protection to prevent battery damage.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;When the battery is not in use for a long time, the smart battery will automatically discharge to 50%, keeping the battery in the best condition, and the service life will last longer.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;If you fly in a cold area, the system will start cryogenic protection, which will control the output of the battery according to the temperature, so that the battery can provide the power at the right temperature and protect the battery from the low temperature damage.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;Smart battery technology can not only monitor battery status, extend service life, but also provide safe and reliable battery monitoring to make flight safer.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', 'Original battery TS50.', 'A smart battery designed for flypie VR6 Pro, with a capacity of 3450mAh and a voltage of 14.4v, provides 28 minutes of flight time. Battery type 4 s energy 50 Wh overall weight 240 g working environment temperature 0 ° C to 40 ° C', 'A smart battery designed for flypie VR6 Pro, with a capacity of 3450mAh and a voltage of 14.4v, provides 28 minutes of flight time. Battery type 4 s energy 50 Wh overall weight 240 g working environment temperature 0 ° C to 40 ° C');
INSERT INTO `flypie_category_description` VALUES (62, 2, '原装电池TS50', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;专为飞拍VR6 Pro设计的智能电池，容量3450mAh,电压14.4V，提供28分钟飞行时间。&lt;/span&gt;&lt;br style=&quot;box-sizing: inherit; color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;飞拍VR6 Pro采用最新技术的智能电池，确保飞行过程中，飞行控制系统能够实时获取当前剩余电量用于计算剩余飞行时间，用户也能通过飞拍无人机APP实时查看电池电芯状态、循环次数、温度等完整信息。&lt;/span&gt;&lt;br style=&quot;box-sizing: inherit; color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;除了飞行过程的状态监控，智能电池管理系统还具备过充和过放保护，防止电池损坏。&lt;/span&gt;&lt;br style=&quot;box-sizing: inherit; color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;当电池长期静置不用时，智能电池将自动放电至50%，让电池保持在最佳状态，使用寿命更长久。&lt;/span&gt;&lt;br style=&quot;box-sizing: inherit; color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;假如你在寒冷的区域飞行，系统将启动低温保护，根据温度控制电量输出，让电池在合适的温度下提供动力，保护电池不受低温损害。&lt;/span&gt;&lt;br style=&quot;box-sizing: inherit; color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;智能电池技术不仅能监控电池状态，延长使用寿命，更重要的是提供安全可靠的电池监控，让飞行更安全。&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '原装电池TS50', '专为飞拍VR6 Pro设计的智能电池，容量3450mAh,电压14.4V，提供28分钟飞行时间。电池类型 4S 能量 50 Wh 电池整体重量 240 g 工作环境温度 0°C至40°C', '专为飞拍VR6 Pro设计的智能电池，容量3450mAh,电压14.4V，提供28分钟飞行时间。电池类型 4S 能量 50 Wh 电池整体重量 240 g 工作环境温度 0°C至40°C');
INSERT INTO `flypie_category_description` VALUES (63, 2, '原装电池TS61', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;专为飞拍VR6 Pro设计的TS61智能电池，容量4250mAh,电压14.4V，提供37分钟飞行时间。&lt;/span&gt;&lt;br style=&quot;box-sizing: inherit; color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;飞拍VR6 Pro&lt;/span&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;采用最新技术的&lt;/span&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;TS61&lt;/span&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;智能电池，确保飞行过程中，飞行控制系统能够实时获取当前剩余电量用于计算剩余飞行时间，用户也能通过飞拍无人机APP实时查看电池电芯状态、循环次数、温度等完整信息。&lt;/span&gt;&lt;br style=&quot;box-sizing: inherit; color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;除了飞行过程的状态监控，智能电池管理系统还具备过充和过放保护，防止电池损坏。&lt;/span&gt;&lt;br style=&quot;box-sizing: inherit; color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;当电池长期静置不用时，TS61智能电池将自动放电至50%，让电池保持在最佳状态，使用寿命更长久。&lt;/span&gt;&lt;br style=&quot;box-sizing: inherit; color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;假如你在寒冷的区域飞行，系统将启动低温保护，根据温度控制电量输出，让电池在合适的温度下提供动力，保护电池不受低温损害。&lt;/span&gt;&lt;br style=&quot;box-sizing: inherit; color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;TS61智能电池技术不仅能监控电池状态，延长使用寿命，更重要的是提供安全可靠的电池监控，让飞行更安全。&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '原装电池TS61', '专为飞拍VR6 Pro设计的TS61智能电池，容量4250mAh,电压14.4V，提供37分钟飞行时间。', '专为飞拍VR6 Pro设计的TS61智能电池，容量4250mAh,电压14.4V，提供37分钟飞行时间。');
INSERT INTO `flypie_category_description` VALUES (64, 2, '原装螺旋桨', '&lt;p&gt;原装螺旋桨6625为飞拍VR6 Pro提供最稳定可靠的动力输出。&lt;br&gt;&lt;/p&gt;', '原装螺旋桨6625', '原装螺旋桨6625为飞拍VR6 Pro提供最稳定可靠的动力输出。', '原装螺旋桨6625为飞拍VR6 Pro提供最稳定可靠的动力输出。');
INSERT INTO `flypie_category_description` VALUES (65, 1, 'Charger', '&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;The VR6 Pro power adapter can be connected to the ac power supply to charge the VR6 Pro smart flight battery and remote control. It takes about 2.5 hours for a single VR6 Pro smart flight battery or remote control to be fully charged. The charging time will be slightly extended while charging.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Original charger', 'The VR6 Pro power adapter can be connected to the ac power supply to charge the VR6 Pro smart flight battery and remote control. It takes about 2.5 hours for a single VR6 Pro smart flight battery or remote control to be fully charged. The charging time wi', 'The VR6 Pro power adapter can be connected to the ac power supply to charge the VR6 Pro smart flight battery and remote control. It takes about 2.5 hours for a single VR6 Pro smart flight battery or remote control to be fully charged. The charging time wi');
INSERT INTO `flypie_category_description` VALUES (65, 2, '原装充电器', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;飞拍VR6 Pro电源适配器可连接交流电源为&lt;/span&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;飞拍VR6 Pro&lt;/span&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;智能飞行电池和遥控器充电。单独为1块&lt;/span&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;飞拍VR6 Pro&lt;/span&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;智能飞行电池或遥控器充满电分别约需时2.5小时。同时充电时充电时间会略有延长。&lt;/span&gt;&lt;/p&gt;', '原装充电器', '飞拍VR6 Pro电源适配器可连接交流电源为飞拍VR6 Pro智能飞行电池和遥控器充电。单独为1块飞拍VR6 Pro智能飞行电池或遥控器充满电分别约需时2.5小时。同时充电时充电时间会略有延长。', '飞拍VR6 Pro电源适配器可连接交流电源为飞拍VR6 Pro智能飞行电池和遥控器充电。单独为1块飞拍VR6 Pro智能飞行电池或遥控器充满电分别约需时2.5小时。同时充电时充电时间会略有延长。');
INSERT INTO `flypie_category_description` VALUES (66, 1, 'Memory card', '&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;Flypie panoramic uav VR6 specified SD dodge high-speed C10 high speed memory card compatible with NVMe standard to meet high quality video recording requirements.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Special memory card.', 'Flypie panoramic uav VR6 specified SD dodge high-speed C10 high speed memory card compatible with NVMe standard to meet high quality video recording requirements.', 'Flypie panoramic uav VR6 specified SD dodge high-speed C10 high speed memory card compatible with NVMe standard to meet high quality video recording requirements.');
INSERT INTO `flypie_category_description` VALUES (66, 2, '专用内存卡', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;飞拍全景无人机VR6 指定SD 闪迪高速 C10高速存储卡兼容NVMe标准,&lt;/span&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;满足高质量视频录制需求。&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '专用内存卡', '飞拍全景无人机VR6 指定SD 闪迪高速 C10高速存储卡兼容NVMe标准,满足高质量视频录制需求。', '飞拍全景无人机VR6 指定SD 闪迪高速 C10高速存储卡兼容NVMe标准,满足高质量视频录制需求。');
INSERT INTO `flypie_category_description` VALUES (67, 2, 'WIFI增强器', '&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;WIFI图传，采用普通无线网络的机制，图像传输，首先要建立无人机和遥控器之间的通讯握手机制，然后再以大小为每个512K的数据包形式传送。Wifi机制下，每个数据包必须都完整无误地传输，一旦数据错误或有丢失的情况，就需要重新发送。飞拍WIFI增强器能够有效地防止受干扰，避免延迟，同时能够减少延时传输。&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'WIFI增强器', 'WIFI图传，飞拍WIFI增强器能够有效地防止受干扰，避免延迟，同时能够减少延时传输。', 'WIFI图传，飞拍WIFI增强器能够有效地防止受干扰，避免延迟，同时能够减少延时传输。');
INSERT INTO `flypie_category_description` VALUES (67, 1, 'WIFI enhancer', '&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;WIFI figure, the mechanism of using common wireless network, image transmission, the first thing to establish drones and remote communication between handshake mechanism, and then at 512 k for each size packets are passed. Under the Wifi mechanism, each packet must be transmitted intact, and once the data is wrong or lost, it needs to be resent. Flying WIFI enhancer can effectively prevent interference, avoid delay, and reduce delay transmission.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'WIFI enhancer', 'WIFI graph transmission, the flying WIFI booster can effectively prevent interference, avoid delay, and can reduce delay transmission.', 'WIFI graph transmission, the flying WIFI booster can effectively prevent interference, avoid delay, and can reduce delay transmission.');
INSERT INTO `flypie_category_description` VALUES (68, 2, '原装遥控器', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;原装遥控器用于控制云台三轴动作以及切换工作模式。&lt;/span&gt;&lt;br style=&quot;box-sizing: inherit; color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;对应三轴的速度控制旋钮，可直观调整对应的各轴遥控速度。&lt;/span&gt;&lt;br style=&quot;box-sizing: inherit; color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Open Sans&amp;quot;, arial, sans-serif; font-size: 16px;&quot;&gt;内置2.4频段无线模块，便于规避信号干扰，保障控制效果。&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '原装遥控器', '原装遥控器用于控制云台三轴动作以及切换工作模式。\r\n对应三轴的速度控制旋钮，可直观调整对应的各轴遥控速度。\r\n内置2.4频段无线模块，便于规避信号干扰，保障控制效果。', '原装遥控器用于控制云台三轴动作以及切换工作模式。\r\n对应三轴的速度控制旋钮，可直观调整对应的各轴遥控速度。\r\n内置2.4频段无线模块，便于规避信号干扰，保障控制效果。');
