INSERT INTO `flypie_category_description` VALUES (68, 1, 'Remote control', '&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;The original remote control is used to control the triaxial movement of the cloud platform and the switching mode.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;The speed control knob of the three axes can be adjusted directly to adjust the speed of each axis remote control.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;Built-in 2.4 frequency band wireless module, easy to avoid signal interference, guarantee control effect.&lt;/span&gt;&lt;/p&gt;', 'Original remote control', 'The original remote control is used to control the triaxial movement of the cloud platform and the switching mode.\r\nThe speed control knob of the three axes can be adjusted directly to adjust the speed of each axis remote control.\r\nBuilt-in 2.4 frequency ', 'The original remote control is used to control the triaxial movement of the cloud platform and the switching mode.\r\nThe speed control knob of the three axes can be adjusted directly to adjust the speed of each axis remote control.\r\nBuilt-in 2.4 frequency ');
