INSERT INTO `flypie_category_description` VALUES (59, 1, 'FlyPieVR6 Pro', '&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;Flypie VR6 Pro is an premium\r\nperformance drone takes you to explore previously inaccessible places easily.\r\nPortable and foldable VR6 Pro ready to go with you everywhere.&amp;nbsp;&lt;font face=&quot;宋体&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;', 'FlyPieVR6 Pro', 'FlyPieVR6 Pro,Recording of 4K video, three-axis mechanical cloud platform, 200 million panoramic image,2KM high clear image transmission, maximum endurance of 37 minutes.', 'FlyPieVR6 Pro,Recording of 4K video, three-axis mechanical cloud platform, 200 million panoramic image,2KM high clear image transmission, maximum endurance of 37 minutes.');
