INSERT INTO `flypie_information_description` VALUES (3, 2, '隐私政策', '&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;最近修订日期：&lt;span lang=&quot;EN-US&quot;&gt;2018 &lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt; 3 &lt;/span&gt;月&lt;span lang=&quot;EN-US&quot;&gt; 14 &lt;/span&gt;日&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;尊敬的用户，欢迎您注册成为本网站用户。在注册前请您仔细阅读如下服务条款：&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;本服务协议双方为本网站与本网站用户，本服务协议具有合同效力。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;您确认本服务协议后，即意味着你同意本协议内容。请您务必在注册之前认真阅读全部服务协议内容，如有任何疑问，可向本网站咨询。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;无论您事实上是否在注册之前认真阅读了本服务协议，只要您点击协议正本下方的&lt;span lang=&quot;EN-US&quot;&gt;&quot;&lt;/span&gt;注册&lt;span lang=&quot;EN-US&quot;&gt;&quot;&lt;/span&gt;按钮并按照本网站注册程序成功注册为用户，您的行为仍然表示您同意并签署了本服务协议。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;b&gt;&lt;span style=&quot;mso-bidi-font-size:10.5pt;\r\nfont-family:&amp;quot;微软雅黑&amp;quot;,sans-serif;mso-bidi-font-family:Arial;color:#5A5A5A;\r\nmso-font-kerning:0pt&quot;&gt;说明&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;a name=&quot;OLE_LINK3&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;深圳市飞拍科技有限公司依据中华人民共和国法律成立的有限责任公司（以下简称“本公司”、“飞拍”、“飞拍科技”或“我们”等&lt;span lang=&quot;EN-US&quot;&gt;),&lt;/span&gt;隐私权是每个人的重要权利&lt;span lang=&quot;EN-US&quot;&gt;,&lt;/span&gt;我们非常重视维护和保护用户的个人信息。您在使用飞拍科技的产品、服务时，我们可能会收集、储存和使用您的个人信息&lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;。本隐私权政策旨在说明、我们如何收集、储存、使用或分享您的个人信息。希望您仔细阅读本《隐私权政策》，以便在需要的时候，能让您作出合适的选择。&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;一旦注册、访问或使用本服务，即表示您明确同意我们可以根据本隐私权政策所述条款收集、存储、使用及披露您的相关信息。&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;b&gt;&lt;span style=&quot;mso-bidi-font-size:10.5pt;\r\nfont-family:&amp;quot;微软雅黑&amp;quot;,sans-serif;mso-bidi-font-family:Arial;color:#5A5A5A;\r\nmso-font-kerning:0pt&quot;&gt;一、我们会通过该服务收集您哪些信息&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;A&lt;/span&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;．您直接、自愿提供给我们的信息&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;您在使用本服务的过程中，视不同的功能需要，我们可能会收集您向我们提交的信息。如您在服务平台注册账户，在注册过程中，可能会提交您的姓名、电子邮件或手机号、通讯地址等信息。&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;B&lt;/span&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;．通过本服务自动收集的信息&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;当您使用该服务时，我们会自动收集您在使用过程中的有关信息。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;若您通过移动设备使用我们的产品或服务时，系统能够读取或存储的信息，如您的信息、产品使用的日志记录、您的电子设备的配置信息、飞行数据、接入我们产品或服务的&lt;span lang=&quot;EN-US&quot;&gt;IP&lt;/span&gt;地址、时间信息、地理环境和位置信息、分享的文字或图片等资源。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;b&gt;&lt;span style=&quot;mso-bidi-font-size:10.5pt;\r\nfont-family:&amp;quot;微软雅黑&amp;quot;,sans-serif;mso-bidi-font-family:Arial;color:#5A5A5A;\r\nmso-font-kerning:0pt&quot;&gt;二、我们如何使用我们所收集的信息&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;我们收集的信息将会有以下使用方式：&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;为你提供服务。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;在我们提供服务时，用于客户服务、安全防范、诈骗监测、存档和备份用途，确保我们向您提供的产品和服务的安全性。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;帮助我们设计新的服务，改善我们的服务。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;向你提供更加相关的广告以代替普遍的广告。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;做产品的使用和服务情况等的调查，如果你参与相关调查，我们将会要求你提供相关的个人信息。&lt;span lang=&quot;EN-US&quot;&gt;&lt;