&lt;span lang=&quot;EN-US&quot;&gt;:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:0cm;text-indent:0cm;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:9.0pt;font-family:&amp;quot;微软雅黑&amp;quot;,sans-serif;mso-bidi-font-family:\r\n微软雅黑;color:#5A5A5A;mso-font-kerning:0pt&quot;&gt;1）&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;事先获得用户的明确授权；&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:0cm;text-indent:0cm;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:9.0pt;font-family:&amp;quot;微软雅黑&amp;quot;,sans-serif;mso-bidi-font-family:\r\n微软雅黑;color:#5A5A5A;mso-font-kerning:0pt&quot;&gt;2）&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;为实现“我们可能如何使用您的个人信息？”章节中的目的授权的产品或服务提供商分享您的信息&lt;span lang=&quot;EN-US&quot;&gt;;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:0cm;text-indent:0cm;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:9.0pt;font-family:&amp;quot;微软雅黑&amp;quot;,sans-serif;mso-bidi-font-family:\r\n微软雅黑;color:#5A5A5A;mso-font-kerning:0pt&quot;&gt;3）&lt;/span&gt;&lt;!--[