uot;EN-US&quot; style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:0cm;text-indent:0cm;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:9.0pt;font-family:&amp;quot;微软雅黑&amp;quot;,sans-serif;mso-bidi-font-family:微软雅黑;\r\ncolor:#5A5A5A;mso-font-kerning:0pt&quot;&gt;6）&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;在紧急的情况下，为了保护公司及其用户之安全&lt;/span&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;；&lt;a name=&quot;OLE_LINK10&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/a&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:0cm;text-indent:0cm;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:9.0pt;font-family:&amp;quot;微软雅黑&amp;quot;,sans-serif;mso-bidi-font-family:微软雅黑;\r\ncolor:#5A5A5A;mso-font-kerning:0pt&quot;&gt;7）&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;为向您提供我们的服务，我们以及我们的关联公司、合作伙伴及第三方服务供应商、承包商及代理，可能会将在必要范围内分享您的个人信息；&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;b&gt;&lt;span style=&quot;mso-bidi-font-size:10.5pt;\r\nfont-family:&amp;quot;微软雅黑&amp;quot;,sans-serif;mso-bidi-font-family:Arial;color:#5A5A5A;\r\nmso-font-kerning:0pt&quot;&gt;四、您的相应权限&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;如果您想查阅或验证您的个人信息，以及查看我们的披露记录时，请联络我们的客户经理或经销商。若在某些情况下我们无法提供相关资料，我们将及时告知您原因。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;在某些情况下您有权选择拒绝向我们提供某些信息，但我们可能因此无法向您提供某些产品、服务或信息。为保护双方利益，例如为确保您的要求被执行、为证明我们向您提供了所需信息，我们可能监控您与飞拍的电话或邮件往来，以保证我们的服务质量。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;如果您不希望接收到我们关于直接营销的沟通，请告知我们，我们将会在直接营销名单中删除您的个人信息。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;如果您不希望我们在飞拍成员中分享您的个人信息，请通知我们。在此情况下，我们由于信息缺失而有可能无法向您提供特定的产品或服务。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;如果您未满十八岁，您应该获得父母或监护人的同意和指导以确保正确使用我们的产品和服务。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 9pt; font-family: 微软雅黑, sans-serif; color: rgb(90, 90, 90); background-im